import NavBar from "./components/NavBar";

import './App.css';
import { BrowserRouter,Routes,Route } from "react-router-dom";
import ProfilePage from "./components/Profile"
function App() {
  return (
    <BrowserRouter>
    <NavBar/>
    <Routes>
      <Route path="profile" element={<ProfilePage/>}></Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
